const normalWeatherImg = "https://media.istockphoto.com/id/1195458582/photo/aerial-view-of-misty-mountains-at-sunrise.webp?b=1&s=170667a&w=0&k=20&c=lpAmjnJf-B8JVOwC1bsANg8V-TFxgonnMo4034s0B7U=";
const clearSkyImg = "https://media.istockphoto.com/id/824800468/photo/sun-on-blue-sky-with-clouds.webp?b=1&s=170667a&w=0&k=20&c=rVSwIECCenLv_NYV76uQQdhc1VwOSkPqoIjHuqNu_sw=";
const fewCloudsImg = "https://images.unsplash.com/photo-1645205406851-d4c6d325119b?ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxwaG90by1yZWxhdGVkfDEwfHx8ZW58MHx8fHx8&w=1000&q=80";
const scatteredCloudsImg = "https://media.istockphoto.com/id/1749757809/photo/cirrocumulus-clouds.webp?b=1&s=170667a&w=0&k=20&c=pnv2ymbt947bQ8jg39EczlOdsWkrYDbuyuXB1d0WkJc=";
const brokenCloudsImg = "https://media.istockphoto.com/id/1488216149/photo/altocumulus.jpg?s=612x612&w=is&k=20&c=btHmutmllBedQ5vTMtTuiDMT19SmtYBA0Lfnct-o1iI=";
const showerRainImg = "https://images.unsplash.com/photo-1501691223387-dd0500403074?w=300&auto=format&fit=crop&q=60&ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxzZWFyY2h8Mnx8c2hvd2VyJTIwcmFpbnxlbnwwfHwwfHx8MA%3D%3D";
const rainImg = "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRC6TyvJFGhmtZqXI3UPIQOgiPfUS6Y0bGS_Q&usqp=CAU";
const thunderStormImg = "data:image/jpeg;base64,";
const snowImg = "data:image/jpeg;base64,";
const mistImg = "data:image/jpeg;base64,";

function getWeatherImg(weather) {
    let imgUrl;
    if(weather == "clear sky") {
        imgUrl = clearSkyImg;
    } else if(weather == "few clouds") {
        imgUrl = fewCloudsImg;
    } else if(weather == "scattered clouds") {
        imgUrl = scatteredCloudsImg;
    } else if(weather == "broken clouds") {
        imgUrl = brokenCloudsImg;
    } else if(weather == "shower rain") {
        imgUrl = showerRainImg;
    } else if(weather == "rain") {
        imgUrl = rainImg;
    } else if(weather == "thunderstorm") {
        imgUrl = thunderStormImg;
    } else if(weather == "snow") {
        imgUrl = snowImg;
    } else if(weather == "mist") {
        imgUrl = mistImg;
    } else {
        imgUrl = normalWeatherImg;
    }

    return imgUrl;
}

export default getWeatherImg;